import React, { useEffect, useState } from 'react'
import ContextCripto, { Cripto } from '../ContextCripto';
import { HistoryChart } from '../config/api';

const InfoCoin = (coin) => {
  const [histData, setHistData] = useState();
  const [days, setDays] = useState(1);
  const [currency] = ContextCripto(Cripto);

  const fetchHistoryData = async () => {
    const response = await fetch(HistoryChart(coin.NAME, days, currency))
    const data = await response.json();
    console.log(data);
    setHistData(data.Data);
  }

  useEffect(() => {
    fetchHistoryData();
  }, []);
  return (
    <div>InfoCoin</div>
  )
}

export default InfoCoin;
